const ArgumentType = require("../../extension-support/argument-type");
const BlockType = require("../../extension-support/block-type");
const Cast = require("../../util/cast");
const log = require("../../util/log");

const blockIconURI =
    "data:image/png;base64,";

const menuIconURI =
    "data:image/png;base64,";

//  ()
const socket = new WebSocket("ws://localhost:8080"); // 

let messageObj = {
    myhealth: 100,
    enemyhealth: 100,
    barrierActive: false,
};

// WebSocket 
socket.onopen = () => {
    console.log("WebSocket connected");
    socket.send(JSON.stringify({ text: "Hello Unity" })); // 
};

// 
socket.onmessage = (event) => {
    const jsonData = JSON.parse(event.data);
    const byteArray = new Uint8Array(jsonData.data);
    // const uint8Array = new Uint8Array(event.data);
    const decodedMessage = new TextDecoder().decode(byteArray);
    console.log("Message from server:", decodedMessage);
    try {
        const temp_messageObj = JSON.parse(decodedMessage);
        messageObj.myhealth = temp_messageObj.myhealth;
        messageObj.enemyhealth = temp_messageObj.enemyhealth;
        messageObj.barrierActive = temp_messageObj.barrierActive;
        console.log("Message from Unity:", temp_messageObj);
    } catch (error) {
        console.error("Error parsing JSON:", error);
    }
};

// WebSocket 
socket.onclose = () => {
    console.log("Connection closed");
};

// WebSocket
function sendMessage(message) {
    if (socket.readyState === WebSocket.OPEN) {
        socket.send(JSON.stringify(message));
        console.log("Message sent:", message);
    } else {
        console.error("WebSocket is not open");
    }
}

class UnityExtension {
    constructor(runtime) {
        this.runtime = runtime;
    }
    getInfo() {
        return {
            id: "unityExtension",
            name: "Unity Control",
            menuIconURI: menuIconURI,
            blockIconURI: blockIconURI,
            blocks: [
                {
                    opcode: "moveForward",
                    blockType: BlockType.COMMAND,
                    text: " [STEP] ",
                    arguments: {
                        STEP: {
                            type: ArgumentType.NUMBER,
                            defaultValue: 50,
                        },
                    },
                },
                {
                    opcode: "turnUp",
                    blockType: BlockType.COMMAND,
                    text: "",
                    arguments: {
                        ANGLE: {
                            type: ArgumentType.NUMBER,
                            defaultValue: 0,
                        },
                    },
                },
                {
                    opcode: "turnDown",
                    blockType: BlockType.COMMAND,
                    text: "",
                    arguments: {
                        ANGLE: {
                            type: ArgumentType.NUMBER,
                            defaultValue: 180,
                        },
                    },
                },
                {
                    opcode: "turnRight",
                    blockType: BlockType.COMMAND,
                    text: "",
                    arguments: {
                        ANGLE: {
                            type: ArgumentType.NUMBER,
                            defaultValue: 90,
                        },
                    },
                },
                {
                    opcode: "turnLeft",
                    blockType: BlockType.COMMAND,
                    text: "",
                    arguments: {
                        ANGLE: {
                            type: ArgumentType.NUMBER,
                            defaultValue: 270,
                        },
                    },
                },
                {
                    opcode: "ifUnity",
                    blockType: BlockType.CONDITIONAL, //  
                    text: " [CONDITION] ",
                    arguments: {
                        CONDITION: {
                            type: ArgumentType.BOOLEAN,
                            defaultValue: true,
                        },
                    },
                },
                {
                    opcode: "isMyHealthGreaterThan",
                    blockType: BlockType.BOOLEAN, //  Boolean (true/false) 
                    text: "HP  [VALUE]",
                    arguments: {
                        VALUE: {
                            type: ArgumentType.NUMBER,
                            defaultValue: 100,
                        },
                    },
                },
                {
                    opcode: "isMyHealthLessThan",
                    blockType: BlockType.BOOLEAN, //  Boolean (true/false) 
                    text: "HP < [VALUE]",
                    arguments: {
                        VALUE: {
                            type: ArgumentType.NUMBER,
                            defaultValue: 100,
                        },
                    },
                },
                {
                    opcode: "isEnemysHealthLessThan",
                    blockType: BlockType.BOOLEAN, //  Boolean (true/false) 
                    text: "HP  [VALUE]",
                    arguments: {
                        VALUE: {
                            type: ArgumentType.NUMBER,
                            defaultValue: 100,
                        },
                    },
                },
                {
                    opcode: "isEnemysHealthLessThan",
                    blockType: BlockType.BOOLEAN, //  Boolean (true/false) 
                    text: "HP < [VALUE]",
                    arguments: {
                        VALUE: {
                            type: ArgumentType.NUMBER,
                            defaultValue: 100,
                        },
                    },
                },
                {
                    opcode: "isMyBarrierActive",
                    blockType: BlockType.BOOLEAN, //  true / false 
                    text: "",
                },
                {
                    opcode: "debug",
                    blockType: BlockType.COMMAND,
                    text: "debug",
                },
            ],
            menus: {},
        };
    }

    moveForward(args) {
        const step = Cast.toNumber(args.STEP);
        log.log(`move forward ${step}`);
        sendMessage({ action: "move", args: step });
    }

    turnUp() {
        log.log("turn Up");
        sendMessage({ action: "rotate", args: 0 });
    }

    turnDown() {
        log.log("turn Down");
        sendMessage({ action: "rotate", args: 180 });
    }

    turnRight() {
        log.log("turn Right");
        sendMessage({ action: "rotate", args: 90 });
    }

    turnLeft() {
        log.log("turn Left");
        sendMessage({ action: "rotate", args: 270 });
    }

    ifUnity(args) {
        if (args.CONDITION) {
            return true;
        } else {
            return false;
        }
    }

    isMyHealthGreaterThan(args) {
        const result = messageObj.myhealth >= args.VALUE;
        console.log(result); // 
        return result; // 
    }

    isMyHealthLessThan(args) {
        const result = messageObj.myhealth < args.VALUE;
        console.log(result); // 
        return result; // 
    }

    isEnemysHealthGreaterThan(args) {
        const result = messageObj.enemyhealth >= args.VALUE;
        console.log(result); // 
        return result; // 
    }

    isEnemysHealthLessThan(args) {
        const result = messageObj.enemyhealth < args.VALUE;
        console.log(result); // 
        return result; // 
    }

    isMyBarrierActive() {
        const result = messageObj.barrierActive;
        console.log(result); // 
        return result; // 
    }

    debug() {
        log.log("myhealth:", messageObj.myhealth);
        log.log("enemyhealth:", messageObj.enemyhealth);
        log.log("barrierActive:", messageObj.barrierActive);
    }
}

module.exports = UnityExtension;
